import React from 'react';
import PostImage from "../customComponents/PostImage";

const PostCard = ({vertical, post}) => {
    return (
        <div className={vertical ? "flex":"w-full mb-8"}>
            <PostImage />
            <div>
                <p>wednesday 12, march 2024</p>
                <h2>{post.title}</h2>
                <p>{post.body}</p>
            </div>
        </div>
    );
};

export default PostCard;
